import React from 'react';
import { Modal, Button, Form } from 'react-bootstrap';
import ModalWrapper from '../../ModalWrapper/ModalWrapper';

interface IProps {
  show: boolean;
  handleShow: () => void;
}

const CreateTypeModal = ({ show, handleShow }: IProps) => {
  return (
    <ModalWrapper show={show} handleShow={handleShow} name="Create Type">
      <Modal.Body>
        <Form>
          <Form.Group className="mb-3" controlId="formBasicEmail">
            <Form.Label>Create Type</Form.Label>
            <Form.Control placeholder="New Type..." />
          </Form.Group>
          <div className="d-flex justify-content-between">
            <Button onClick={handleShow} variant="primary" type="submit">
              Submit
            </Button>
            <Button variant="secondary" onClick={handleShow}>
              Close
            </Button>
          </div>
        </Form>
      </Modal.Body>
    </ModalWrapper>
  );
};

export default CreateTypeModal;
